import React, {Component, Fragment} from 'react'
import DeskTopLayout from '../../components/layouts/deskTopLayout'

class Bingo extends Component {
  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>Bingo</h1>
          <div className="about">
            Electronics
          </div>

        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default Bingo
